import { AllDOGS } from "./action-types"
import axios from 'axios'

export const Alldogs =  ()=>{
    return async (dispatch)=>{
        try {
            const endpoint = 'http://localhost:3001/dogs'
            const {data} = await axios.get(endpoint)
           // const priemrabusqueda = []

            let breeds=data.datos
          //  console.log("Datos de resultado: " + JSON.stringify(breeds));
            const primeraBusqueda = [];

            breeds.map(breedArray => {
              const idDogsGroup = breedArray.id;
            
              const breedData = breedArray.forEach(breed => ({
                breeds: idDogsGroup,
                idDogs: breed.id,
                name: breed.name,
                url: breed.url,
                temperament: breed.temperament
              }));
            
              primeraBusqueda.push(...breedData);
            });
            
            console.log(primeraBusqueda);
            


                dispatch({
                    type: AllDOGS,
                    payload: primeraBusqueda,
                })



        } catch (error) {
            console.error("El dato de error es: "+error)
        }
    }
}
